u8 get_default_idx(gb_device_t device) {
    if(device == device_GB_cpu_dmg0) {
        return 0_u8;
    } else if(device == device_GB_cpu_dmg || device_MGB_cpu_mgb) {
        return 1_u8;
    } else if(dev_is_SGB(device)) {
        return 2_u8;
    } else if(dev_is_GBC(device)) {
        return 3_u8;
    } else {
      unreachable();
    }
}

